/**
 * Returns the definition of a collector that captures `count`
 * @return {Object} A `count` collector object
 */
export default function () {
  return {
    name: 'count',
    initialValue: 0,
    onUpdate: function (prev) {
      return prev + 1;
    }
  };
}

/**
 * Returns the definition of a collector that captures a filtered
 * count based off of the passed in filter.
 * @param  {String} name The name of the collector
 * @param  {Function} filter A function that is takes a value and returns true or false
 * @return {Object} A `filtered count` collector object
 */
export default function (name, filter) {
  return {
    name: name,
    initialValue: 0,
    onUpdate: function (prev, state, val) {
      return filter(val) ? prev + 1 : prev;
    }
  };
}

/**
 * Returns the definition of a collector that captures `max`
 * @return {Object} A `max` collector object
 */
export default function () {
  return {
    name: 'max',
    initialValue: Number.MIN_VALUE,
    onUpdate: function (prev, state, val) {
      return Math.max(prev, val);
    }
  };
}

/**
 * Returns the definition of a collector that captures `mean`
 * @return {Object} A `mean` collector object
 */
export default function () {
  return {
    name: 'mean',
    initialValue: 0,
    requirements: ['count'],
    onUpdate: function (prev, state, val) {
      return prev + (val - prev) / state.count;
    }
  };
}

/**
 * Returns the definition of a collector that captures `min`
 * @return {Object} A `min` collector object
 */
export default function () {
  return {
    name: 'min',
    initialValue: Number.MAX_VALUE,
    onUpdate: function (prev, state, val) {
      return Math.min(prev, val);
    }
  };
}

 /**
  * Returns the definition of a collector that captures `powerSumAvg_running`
  *   - Modified from the following source:
  *     https://subluminal.wordpress.com/2008/07/31/running-standard-deviations/
  * @return {Object} A `powerSumAvg_running` collector object
  */
export default function () {
  return {
    name: 'powerSumAvg_running',
    initialValue: 0,
    requirements: ['count'],
    onUpdate: function (prev, state, val) {
      let newValue = prev;
      newValue += (val * val - prev) / state.count;
      return newValue;
    }
  };
}

 /**
  * Returns the definition of a collector that captures `standardDeviation_running`
  *   - Modified from the following source:
  *     https://subluminal.wordpress.com/2008/07/31/running-standard-deviations/
  * @return {Object} A `standardDeviation_running` collector object
  */
export default function () {
  return {
    name: 'standardDeviation_running',
    initialValue: 0,
    requirements: ['variance_running'],
    onGet: function (prev, state) {
      return Math.sqrt(state.variance_running);
    }
  };
}

/**
 * Returns the definition of a collector that captures `standardDeviation_stable`
 * @return {Object} A `standardDeviation_stable` collector object
 */
export default function () {
  return {
    name: 'standardDeviation_stable',
    initialValue: 0,
    requirements: ['variance_stable'],
    onGet: function (prev, state) {
      return Math.sqrt(state.variance_stable);
    }
  };
}

/**
 * Returns the definition of a collector that captures `sum`
 * @return {Object} A `sum` collector object
 */
export default function () {
  return {
    name: 'sum',
    initialValue: 0,
    onUpdate: function (prev, state, val) {
      return prev + val;
    }
  };
}

/**
 * Returns the definition of a collector that captures `sumOfSquaredDeviations_stable`
 * @return {Object} A `sumOfSquaredDeviations_stable` collector object
 */
export default function () {
  return {
    name: 'sumOfSquaredDeviations_stable',
    initialValue: 0,
    requirements: ['values', 'mean'],
    onGet: function (prev, state) {
      const len = state.values.length;
      let sum = 0;
      let current = 0;
      for (let i = 0; i < len; i++) {
        current = state.values[i];
        sum += Math.pow(current - state.mean, 2);
      }
      return sum;
    }
  };
}

/**
 * Returns the definition of a collector that captures `values`
 * @return {Object} A `values` collector object
 */
export default function () {
  return {
    name: 'values',
    initialValue: [],
    onUpdate: function (prev, state, val) {
      const result = prev.slice(0);
      result.push(val);
      return result;
    }
  };
}

 /**
  * Returns the definition of a collector that captures `variance_running`
  *   - Modified from the following source:
  *     https://subluminal.wordpress.com/2008/07/31/running-standard-deviations/
  * @return {Object} A `variance_running` collector object
  */
export default function () {
  return {
    name: 'variance_running',
    initialValue: 0,
    requirements: ['count', 'mean', 'powerSumAvg_running'],
    onGet: function (prev, state) {
      return (state.powerSumAvg_running * state.count -
        state.count * state.mean * state.mean) / (
        state.count - 1);
    }
  };
}

/**
 * Returns the definition of a collector that captures `variance_stable`
 * @return {Object} A `variance_stable` collector object
 */
export default function () {
  return {
    name: 'variance_stable',
    initialValue: 0,
    requirements: ['values', 'sumOfSquaredDeviations_stable'],
    onGet: function (prev, state) {
      const len = Math.max(1, state.values.length - 1);
      return state.sumOfSquaredDeviations_stable / len;
    }
  };
}

/**
 * Filter even values
 * @param  {Number} value The value to Filter
 * @return {Boolean} true if value is even, false otherwise
 */
export default function (value) {
  return value % 2 === 0;
}

/**
 * Filter float values
 * @param  {Number} value The value to Filter
 * @return {Boolean} true if value is a float, false otherwise
 */
export default function (value) {
  return value % 1 !== 0;
}

/**
 * Filter integer values
 * @param  {Number} value The value to Filter
 * @return {Boolean} true if value is an integer, false otherwise
 */
export default function (value) {
  return value % 1 === 0;
}

/**
 * Filter negative values
 * @param  {Number} value The value to Filter
 * @return {Boolean} true if value is negative, false otherwise
 */
export default function (value) {
  return value < 0;
}

/**
 * Filter nonZero values
 * @param  {Number} value The value to Filter
 * @return {Boolean} true if value is nonZero, false otherwise
 */
export default function (value) {
  return value !== 0;
}

/**
 * Filter odd values
 * @param  {Number} value The value to Filter
 * @return {Boolean} true if value is odd, false otherwise
 */
export default function (value) {
  return value % 2 === 1;
}

/**
 * Filter positive values
 * @param  {Number} value The value to Filter
 * @return {Boolean} true if value is positive, false otherwise
 */
export default function (value) {
  return value > 0;
}

import leastFactor from '../helpers/leastFactor';

/**
 * Filter prime values
 * @param  {Number} value The value to Filter
 * @return {Boolean} true if value is prime, false otherwise
 */
export default function (value) {
  if (value % 1 || value < 2) {
    return false;
  }
  if (value == leastFactor(value)) {
    return true;
  }
  return false;
}

/**
 * Filter zero values
 * @param  {Number} value The value to Filter
 * @return {Boolean} true if value is zero, false otherwise
 */
export default function (value) {
  return value === 0;
}

